import axios from 'axios';
import React, { Component } from 'react';
import Marquee from 'react-marquee-master';
import '../styles/Lists.scss';

export default class Lists extends Component {

    constructor() {
        super()
        this.state = {
            result: [],
        }
    }

    componentDidMount() {

        const _this = this;

        axios.get('http://criminalimpulse.com/api/topplayerlist')
            .then(function (response) {
                let listTopPlayer = response.data;

                return _this.setState({
                    result: listTopPlayer,
                })
            })
            .catch(function (error) {
                console.log(error);
            });
    }

    render() {
        console.log(this.state);
        const { result } = this.state;
        console.log(result);
        const menuhere = ["one", "two", "three", "four"]
            return (
                <div height='300px' className='player-left'>
                    <p className='listHeading'>Menu Heading</p>,
                    <Marquee minHeight='250' marqueeItems={menuhere} />
                </div>,
                <div height='300px' className='player-right'>
                    <p className='listHeading'>Menu Heading</p>
                    <Marquee minHeight='250' marqueeItems={menuhere} />
                </div>

            );
    }
}
